// This component displays all the cards
import React from 'react'
import { Link } from "react-router-dom"; 
import { Typography, Card, CardContent, CardMedia, Grid} from "@mui/material";
import CheckCircleIcon from "@mui/icons-material/CheckCircle";

const VideoCard = (props) => (
  <Card 
  sx={{ 
    width: { xs: '100%', sm: '358px', md: "270px", }, 
    boxShadow: "none", 
    borderRadius: "10px" }}>

    <Link to={props.url}>
      <CardMedia image={props.image} 
        sx={{ 
          width: { xs: '100%', sm: '358px'}, 
          height: 180 }} 
      />
    </Link>

    <CardContent 
    sx={{ 
      backgroundColor: "primary.main", 
      height: '120px' }}>

      <Link to={props.url} >
        <Typography 
        variant="subtitle1" 
        fontWeight="bold" 
        color="primary.dark">
        {/* The slice function is  used to reduce the title length to 60*/}
          {props.title.slice(0, 60)}
        </Typography>

      </Link>
      <Link to={props.url} >

        <Typography variant="subtitle2" color="primary.light">
          {props.channelTitle}
          <CheckCircleIcon sx={{ fontSize: "12px", color: "#468B97", ml: "5px" }} />
        </Typography>

        {/* This is hard coded for now, just displays two tage that the video is AI generated or human generated */}
        <Grid container paddingTop={1}>
            <Typography fontSize="0.5rem" color="white" backgroundColor="#EF6262" padding="3px" borderRadius="5px">
                AI description
            </Typography>
            <Typography fontSize="0.5rem" color="white" backgroundColor="#F3AA60" padding="3px" borderRadius="5px" sx={{ marginLeft: "15px" }}>
                Human description
            </Typography>
        </Grid>

      </Link>
    </CardContent>
  </Card>
);

export default VideoCard
